INSERT INTO public.fitness_program (id, name, description, sequence, duration, link_to_image, link_to_thumbnail) VALUES ('7402521b-1668-4197-9284-b18f1dcf9488', 'Comprehensive Full-Body Mastery', 'Dive into a robust six-week regimen designed to harness the strength and endurance of all your major muscle groups, culminating in masterful control over your full body.', 'Weekly', 4, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/barbell-back-squat.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/barbell-back-squat-thumbnail.jpg');
INSERT INTO public.fitness_program (id, name, description, sequence, duration, link_to_image, link_to_thumbnail) VALUES ('24dbeaa4-e403-46a6-8027-b914c321f9db', 'Lower Body Blitz', 'A concentrated four-week program focusing on the pillars of your physique, targeting the legs and glutes. Prepare for a power-packed transformation down below!', 'Weekly', 4, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/glute-bridge.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/glute-bridge-thumbnail.jpg');
INSERT INTO public.fitness_program (id, name, description, sequence, duration, link_to_image, link_to_thumbnail) VALUES ('29153473-448f-484a-9c4e-d363d1c3e968', 'Upper Body Enhancer', 'Crafted for those wanting to amplify their upper body aesthetics and strength, this four-week regimen will sculpt, tone, and empower your torso and arms.', 'Weekly', 4, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/dumbbell-row.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/dumbbell-row-thumbnail.jpg');
INSERT INTO public.fitness_program (id, name, description, sequence, duration, link_to_image, link_to_thumbnail) VALUES ('47d452f0-1f8c-4d7e-8644-281247aa4e8a', 'The Balanced Body Program', 'Over five weeks, experience a harmonious blend of total body toning and focused upper body strengthening, achieving a balanced and symmetrical physique.', 'Cycle', 5, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/lunge.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/lunge-thumbnail.jpg');
INSERT INTO public.fitness_program (id, name, description, sequence, duration, link_to_image, link_to_thumbnail) VALUES ('6208fd9c-f477-4ddb-b57c-eac1813795ca', 'The Ultimate Transformation', 'As the name suggests, undergo a transformative journey over six weeks. Combining full-body routines with specialized sessions, it''s a comprehensive overhaul of strength, tone, and endurance.', 'Cycle', 6, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/deadlift.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/deadlift-thumbnail.jpg');
